import {  FaTwitterSquare } from "react-icons/fa";
const Contacts = () => {
  return (
    <div className="contacts">
      <div className="container">
        <p>
          We like to have a connection with our clients through different
          platforms
        </p>
        <h2>Get in touch with us</h2>
        <i><FaTwitterSquare /></i>
        <i><FaTwitterSquare /></i>
        <i><FaTwitterSquare /></i>
        <i><FaTwitterSquare /></i>
        <i><FaTwitterSquare /></i>
        <i><FaTwitterSquare /></i>
        <i><FaTwitterSquare /></i>
      </div>
    </div>
  );
};
export default Contacts;
